#!/usr/bin/perl
use 5.010;
use warnings;
use strict;
use Net::DNS::Resolver;
use Net::Whois::IP qw(whoisip_query);

# takes the stuff from my router and looks at traffic hogs
# also does light investigation to see if they are known/dangerous

# here is a sample output from the 500 log entry sample attached
# COUNT, IP, DNS/NAME, PORTSLIST


#7,104.21.9.92,'CLOUDFLARENET',59035,17744,17734,
#20,149.137.81.195,'ZVC',8801,
#67,149.154.167.50,'Telegram_Messenger_Network',38900,37732,36756,33794,33644,33260,32822,60992,60942,60564,60460,60348,60168,59462,59198,58838,58724,
#7,172.67.159.186,'CLOUDFLARENET',55895,18087,18086,
#7,173.194.200.127,'GOOGLE',19302,
#3,192.146.154.4,'NUTANIX-CORP-IPV4',4501,
#105,192.146.155.44,'NUTANIX-CORP-IPV4',62140,62137,62138,61776,61774,61773,61598,61596,61595,61552,61550,61549,61517,61515,61514,61499,61497,61496,61480,61478,61477,
#56,192.225.158.2,'a-sac.aa.online-metrix.net',3478,18558,18508,18487,18444,17365,16504,16460,16368,
#26,208.67.222.222,'resolver1.opendns.com',25442,53830,58863,50290,58786,59969,
#2,5.62.53.22,'AVAST-COM',49806,49805,
