# now I can investigate further if I wish:
# https://db-ip.com/70.34.16.148 (some wireless company, why?)
# https://db-ip.com/149.137.81.195 (zoom video)
# https://db-ip.com/149.154.167.50 (I think this is browser plugin stuff to whats app)
# etc, etc


# holds all destinations as a hash of arrays 
# the arrays are duplicated ports until we process further
my %conns;

# stores just the count for these destinations
my %conns_count;

# read our data handle into array
my @data = <DATA>;

# attempt to crudely process these log entries
foreach my $data (@data) {

    # there is a minor way that the logs are different, so normalize our logs
    $data =~ s/\[ /\[/;

    # ok, they are normalized, now split
    my @line = split(" ",$data);

    # I'm only interested in the blocked stuff
    # so I can update my firewall rules and allow things that are safe
    my $action = $line[5];

    if ($action =~/Denied/) {

        # extract chunks we want to investigate
        my @destip = split(/\=/,$line[9]);
        my @destpt = split(/\=/,$line[17]);
        
        my $dest =  $destip[1];
        my $port = $destpt[1];

        # this is an array reference black magic stuff
        push ( @{ $conns{ $dest } },$port);

        # update this hash with value of count
        $conns_count{$dest}++;
    } else {
        # using warn so I can capture other prints, warn doesn't go through > redirect
        # fixme:  I should really open a CSV instead of macguyver my own version
        # in practice this spits out the "allowed" connections to console during runtime
        warn "LOG ENTRY ERROR:  $data\n";
    }
}

# perlfaq 4 array dedupe
sub uniq {
    my %seen;
    grep !$seen{$_}++, @_;
}


# we have unique IPs at least, let's investigate further
foreach my $ip (sort keys %conns){

    # tell us our count
    print "$conns_count{$ip},";
    # try to find out what we think it is by DNS lookup
    # not suprisingly, because of load balancers, floating ips, cloud, etc
    # this fails a lot more than I had hoped.
    my $res = new Net::DNS::Resolver(

            # we are going to use my router, then opendns as fall backs to do our tests.
            nameservers => [ '192.168.1.1', '208.67.222.222', '208.67.220.220' ],
            #debug       => 1 # spews entire DNS query results
            recurse     => 1, 
            # 1 = recursive, accurate, keeps asking anyone, even poisoned caches until it thinks answer is right
            # 0 = iterative, final answer, no verification from others
            #iterative is probably how security should be handled.   
        );
 
        # even with timeout of 5 this can take hours on a large list
        $res->tcp_timeout(5);
 
        # change IP from 192.168.1.15 to 15.1.168.192.in-addr.arpa for searching
        my $target_IP = join('.', reverse split(/\./, $ip)).".in-addr.arpa";
 
        # query DNS, hoping we get the PTR record
        my $query = $res->query("$target_IP", "PTR");
 
        # if a result is found
        if ($query){
            print("$ip,'");
 
            # for every result, print the IP address
            foreach my $rr ($query->answer){
                # show all unless the type is PTR (pointer to a canonical name)
                next unless $rr->type eq "PTR";
 
                # remove the period at the end
                printf(substr($rr->rdatastr, 0, -1));
                print "','";
            }
        } else {
            # DNS resolver couldn't find reverse pointer, let's look up the whois instead
            # maybe this is first check we should do?
            
            #my ($response,$array_of_responses) = whoisip_query($ip,$optional_multiple_flag,$optional_raw_flag,$option_array_of_search_options);
            my $response = whoisip_query($ip); 

            # print them all to see what we want to see, looks like "netname" is what we want
            #foreach (sort keys(%{$response}) ) { print "$_ $response->{$_} \n"; }
            
            # netname key is specified different ways.
            if (exists $response->{'NetName'} ){
                print "$ip,'$response->{'NetName'}','"; 
            
            } elsif (exists $response->{'netname'}) {
            
                print "$ip,'$response->{'netname'}','"; 
            } else {
                # couldn't find that either
                print "$ip,'UNKNOWN','";
            }
        

        }
    # ok, we think we know what this is, now, what ports does it use?
    # first, get a reference to the array stored in this key value
    my $ports = $conns{$ip};

    # now, get a unique list from the array dereference
    my @unique_ports = uniq(@$ports);

    # then simply print them out
    # ctrl+h on excel, replace ; with ctrl+j if you like that type of look
    # otherwise, just use a ; to separate the ports
    foreach my $port (@unique_ports){print "$port;"}

    # when we are done, add a new line
    print "'\n";
}




